import React from 'react'
import { render } from 'react-dom'





let countMorn = 0;
let countEven = 0;
let countAfter = 0;
let countNi = 0;


export default class DownloadTime extends React.Component{
    constructor(props)
    {
        this.state = {
            countMorning: 0,
            countAfternoon: 0,
            countEvening: 0,
            countNight:0
        };
    }
    
    /*
    this.props.data.downloads.map(

    )*/


    

   // console.log(Data.parse(this.props.data.downloads));


